import React from 'react';
import styled from 'styled-components';

import { Header } from './components/Header';

const Wrapper = styled.div`
  margin: 0 auto;
  width: 100%;
  height: 100v
  background-color: #000;
  display: flex;
  flex-direction: column;
`;

function App() {
  return (
    <Wrapper>
      Hello React App
      <Header />
    </Wrapper>
  );
}

export default App;
